int n,m,q;
vector<pair<long long,int> > added;
pair<long long,int> x[500005];
pair<int,int> cnt[500005];
int inq[500005];
int ans[500005];

struct BIT{
	int dt[500005];
	void add(int a,int x){
		while(a<500005){
			dt[a]+=x;
			a+=(a&-a);
		}
	}
	int qsum(int a){
		int sum=0;
		while(a){
			sum+=dt[a];
			a-=(a&-a);
		}
		return sum;
	}
}bit;

int qdjg(int a){
	int l=0,r=500005;
	while(r-l>1){
		int m=(l+r)>>1;
		if(bit.qsum(m)<a+1){
			l=m;
		}else{
			r=m;
		}
	}
	return r;
}

int main(){
	scanf("%d%d%d",&n,&m,&q);
	for(int i=0;i<n;i++){
		int ff;
		scanf("%d",&ff);
		cnt[ff].first++;
		cnt[ff].second=ff;
	}
	for(int i=1;i<=m;i++){
		cnt[i].second=i;
	}
	added.push_back(make_pair(0,0));
	for(int i=1;i<=m;i++){
		added.push_back(make_pair(cnt[i].first,i));
	}
	sort(cnt+1,cnt+m+1);
	sort(added.begin(),added.end());
	for(int i=0;i<q;i++){
		scanf("%I64d",&x[i].first);
		x[i].first--;
		x[i].second=i;
	}
	sort(x,x+q);
	int djg=0,Cnt=0;
	long long all=n;
	for(int i=0;i<q;i++){
		while(all+(added[djg+1].first-added[djg].first)*Cnt<=x[i].first&&djg<m){
			all+=(added[djg+1].first-added[djg].first)*Cnt;
			djg++;
			bit.add(added[djg].second,1);
			Cnt++;
		}
		ans[x[i].second]=qdjg((x[i].first-all)%djg);
	}
	for(int i=0;i<q;i++){
		printf("%d\n",ans[i]);
	}
	return 0;
}